import { useState } from 'react';
import axios from 'axios';
import './App.css'

function App() {
  const [dataFromServer, setDataFromServer] = useState([]);

  const sendData = async () => {
    try {
      await axios.post('http://127.0.0.1:8080');
    } catch (error) {
      console.log(error);
    }
  };

  return (
    <div className="App">
      <button onClick={sendData}>Twit</button>
    </div>
  );
}

export default App;
